import Header from "../compoments/layout/Header";
import Footer from "../compoments/layout/Footer";
import HomeSection from "../compoments/body/HomeSection";
import Thumbnail from "../compoments/body/Thumbnail";
import "../styles/home.css";
import logements from "../datas/datas.json";


function Home() {
  return (
    <div className="Home">
      <Header />
      <HomeSection /> 
    <div className="thumbnail">
      {logements.map(({ cover, title, index}) => (
        <Thumbnail 
        key={`${title}-${index}`}  
        cover={cover}
        title={title}
      />
    ))}
    </div>
      <Footer />
    </div>
  );
}

export default Home;
